Вы станете участником клуба атмосферных напитков WINE&SPIRITS и получите возможность пользоваться постоянной скидкой на сопутствующие товары, а также накапливать бонусные баллы.
Готовитесь к празднику, и ищете напиток, способный удивить гостей? А может решили провести вечер дома, и хотите дополнить атмосферу любимым вином? В сети WINE&SPIRITS вы найдете то, что нужно, а каждый визит в наши магазины с новым приложением будет еще приятнее. Достаточно показать кассиру QR-код и можно оплатить бонусными баллами до 50% стоимости сопутствующих товаров и получить скидку.
С приложением вы будете получать бонусные баллы за каждую покупку в наших магазинах, за приглашение друзей в клуб WINE&SPIRITS, а также за прохождение обучающих тестов и опросов.
Приложение позволяет:
●	накапливать бонусные баллы, чтобы получать дополнительную выгоду;
●	увеличивать размер скидки в зависимости от ваших покупок;
●	получать доступ к авторским материалам от сомелье и узнавать больше о любимых напитках;
●	проходить обучающие тесты, чтобы проверить свои знания о вине, крепких напитках и коктейлях;
●	находить ближайший к вам магазин WINE&SPIRITS и стоить к нему удобный маршрут;
●	делиться мнением о любимых напитках и рассказывать нам о своих предпочтениях;
●	первыми узнавать новости о предстоящих акциях, мероприятиях и дегустациях.

"Magnit delivery" is an application for home delivery of groceries from Magnit. For residents of Moscow and Krasnodar. Magnit is now at your home!

In the application:
• no more heavy packages – we will bring purchases directly to the door and hand them over without contact;
• we will select goods as for ourselves. And if something is out of stock – we will offer a worthy replacement!

In the new application "Magnit Delivery" you can:
• order groceries from 5,000 names with home delivery in Moscow and 25,000 names with home delivery in Krasnodar
• pay for the order by card in the application;
• register and store order history;
• receive push notifications with order status;
Also you can set up notifications, read privacy policies and contact support in personal account.

Delivery terms in Moscow:
• within 60 minutes within the MKAD;
• daily from 8:00 to 22:00;
• delivery cost from 49 rubles and free for orders over 999 rubles;
• weight limit – 30 kg.

Delivery terms in Krasnodar:
• after 3 hours at the same day, or at 60 min time interval 
• daily from 10:00 to 22:00;
• minimum order amount is 500 rubles;
• delivery cost 199 rubles and free for orders over 3000 rubles; 
• weight limit – 50kg.
